import React from "react";
import "./Header.scss";
import logo from "../../assets/images/logo.png";
import searchIcon from "../../assets/images/ic_Search@2x.png.png";

function Header() {
  return (
    <div className="header">
      <div className="wrapper__container">
        <img className="header__logo" src={logo} alt="Mercado Libre Logo" />

        <div className="header__search">
          <input className="header__searchInput" type="text" />
          <div className="header__searchIcon__container">
            <img src={searchIcon} className="header__searchIcon" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Header;
